import QuoteList from "../components/quotes/QuoteList";

const Data = [
  { id: "q1", author: "Rosuljon", text: "Rosuljon is the best" },
  { id: "q2", author: "Gulhayo", text: "Gulhayo is the second best" },
];
const AllQuotes = () => {
  return <QuoteList quotes={Data} />
};
export default AllQuotes;
